    'about.AboutBrand': 'Despre OLX',
    'about.AboutText1': 'OLX este principala platform\u0103 de anun\u0163uri publicitare gratuite din lume, concentrat\u0103 pe pie\u0163ele \xEEn dezvoltare, at\xE2t \xEEn spa\u0163iul dispozitivelor mobile, c\xE2t \u015Fi online',
    'about.AboutText2': 'OLX este activ\u0103 pe plan global \u015Fi este prezent\u0103 \xEEn peste 40 de \u0163\u0103ri',
    'about.about_Body': '<p>OLX este genera\u0163ia urm\u0103toare de anun\u0163uri publicitare gratuite online.<br /><br /> OLX furnizeaz\u0103 o solu\u0163ie simpl\u0103 pentru complica\u0163iile legate de v\xE2nz\u0103ri, cump\u0103r\u0103ri, negocieri, discu\u0163ii, organizare \u015Fi \xEEnt\xE2linre a persoanelor din vecin\u0103tatea dvs., oriunde v-a\u0163i afla.<br /><br /> Pe OLX pute\u0163i:<br /><ul> <li>Crea\u0163i u\u015For anun\u0163uri complexe cu imagini.</li> <li>Controla v\xE2nzarea, cump\u0103rarea \u015Fi activitatea dvs. \xEEn comunitate pe Pagina mea OLX</li> <li>Afi\u015Fa anun\u0163urile pe profilul dvs. de pe o re\u0163ea social\u0103 (Facebook, Myspace, ...)</li> <li>Accesa site-ul de pe telefonul dvs. mobil</li> <li>Vizualiza OLX \xEEn limba zonei dvs.</li></ul> <br /> OLX este folosit \xEEn mai mult de <<QTY_COUNTRIES>> de \u0163\u0103ri \xEEn <<QTY_LANGUAGES>> limbi. Compania a fost \xEEnfiin\u0163at\u0103 \xEEn martie 2006 \u015Fi este de proprietate privat\u0103.</p>',
