    'featured_listings.AdditionalTermsForFeaturedAds': 'Condi\u0163ii suplimentare pentru Anun\u0163uri Eviden\u0163iate',
    'featured_listings.AdditionalTermsForFeaturedAds_content': 'Aceste condi\u0163ii suplimentare, pe l\xE2ng\u0103 <<LINK_TERMS_USE>>Termenii de utilizare<</LINK_TERMS_USE>> ai Website-ului trateaz\u0103 utilizarea Anun\u0163urilor Eviden\u0163iate :<br /><ul><li>Ca dovad\u0103 a pl\u0103\u0163ii pentru un Anun\u0163 Eviden\u0163iat , OLX va emite doar o "Confirmare comand\u0103" pe care o ve\u0163i vedea la sf\xE2r\u015Fitul procesului de plat\u0103 \u015Fi un email de confirmare.</li><li>Dac\u0103 pentru un motiv sau altul, fie tehnic sau de orice alt\u0103 natur\u0103, anun\u0163ul dvs. nu apare \xEEn sec\u0163iunea "Anun\u0163 Eviden\u0163iat", singura obliga\u0163ie a OLXeste s\u0103 introduc\u0103 anun\u0163ul dvs. \xEEn sec\u0163iunea "Anun\u0163 Eviden\u0163iat" c\xE2t de repede posibil.</li><li>Solu\u0163ia noastr\u0103 de facturare este oferit\u0103 de c\u0103tre un alt furnizor de servicii.</li><li>La discre\u0163ia OLXorice Anun\u0163uri cu caracter ofensator, pornografice, spam (inclusiv list\u0103rile duble), eventualele \xEEn\u015Fel\u0103ciuni sau care violeaz\u0103 drepturi de autor nu vor fi eviden\u0163iate \u015Fi nu vor fi rambursate.</li><li>ACEST SERVICIU DE ANUN\u0162URI EVIDEN\u0162IATE ESTE FURNIZAT "A\u015EA CUM ESTE" SAU "A\u015EA CUM ESTE DISPONIBIL", F\u0102R\u0102 NICIUN FEL DE GARAN\u0162II \xCEN M\u0102SURA PERMIS\u0102 DE LEGE.  OLX NU D\u0102 NICIO DECLARA\u0162IE SAU GARAN\u0162IE \u015EI NU-\u015EI ASUM\u0102 R\u0102SPUNDEREA SAU RESPONSABILITATEA PENTRU EXACTITATEA SAU EXHAUSTIVITATEA CON\u0162INUTULUI INCLUS \xCEN SERVICIUL DE ANUN\u0162 EVIDEN\u0162IAT.</li></ul>',
    'featured_listings.Benefits': 'Beneficii',
    'featured_listings.Benefits_content': 'Anun\u0163ul dvs. prime\u015Fte o \xEEncadrare mai bun\u0103 dac\u0103 apare \xEEn sec\u0163iunile pentru List\u0103ri Eviden\u0163iate descrise \xEEn continuare. Imaginile de mai jos ilustreaz\u0103 cele dou\u0103 tipuri de Anun\u0163uri Eviden\u0163iate disponibile.',
    'featured_listings.Feature': 'Eviden\u0163iere',
    'featured_listings.FeaturedListings_Content': 'Serviciul de Anun\u0163 Eviden\u0163iat permite ca anun\u0163ul dvs. s\u0103 apar\u0103 \xEEn sec\u0163iunile de Anun\u0163 Eviden\u0163iat asigur\xE2nd anun\u0163ului dvs. de 20 de ori mai mult\u0103 vizibilitate dec\xE2t cea a unui anun\u0163 obi\u015Fnuit!*',
    'featured_listings.FeatureMyListing': 'Eviden\u0163iaz\u0103 anun\u0163ul meu',
    'featured_listings.FeatureYourListingForUp20TimesVisibility': '<<LINK_FEATURED_LISTINGS>>Eviden\u0163ia\u0163i-v\u0103 listarea<</LINK_FEATURED_LISTINGS>> pentru o vizibilitate de 20 de ori mai mare!',
    'featured_listings.HowDoesItWork': 'Cum func\u0163ioneaz\u0103?',
    'featured_listings.HowDoesItWork_New': '\xCEn cazul anun\u0163urilor eviden\u0163iate \xEEn Topul listelor \u015Fi rezultatelor c\u0103ut\u0103rii, anun\u0163urile eviden\u0163iate sunt afi\u015Fate \xEEn subcategoria corespunz\u0103toare \u015Fi apar prin rota\u0163ia aleatorie a tuturor anun\u0163urilor eviden\u0163iate din acea subcategorie \u015Fi din acea zon\u0103. Selec\u0163ia de anun\u0163uri eviden\u0163iate este \xEEntotdeauna generat\u0103 \xEEn manier\u0103 aleatorie pentru a da posibilitatea tuturor celor care au achizi\u0163ionat anun\u0163uri eviden\u0163iate s\u0103 aib\u0103 aceea\u015Fi probabilitate de a ap\u0103rea pe site-ul web. Din acest motiv este posibil ca anun\u0163ul dvs. s\u0103 nu apar\u0103 mereu \xEEn sec\u0163iunea corespunz\u0103toare de anun\u0163uri eviden\u0163iate.',
    'featured_listings.HowDoIBuyAFeaturedListing': 'Cum pot cump\u0103ra un Anun\u0163 eviden\u0163iat?',
    'featured_listings.HowDoIBuyAFeaturedListing_New': 'Pute\u0163i achizi\u0163iona un anun\u0163 eviden\u0163iat din ultima etap\u0103 a procesului de publicare, unde vi se confirm\u0103 c\u0103 anun\u0163ul dvs. a fost publicat sau din sec\u0163iunea My OLX. Procesul este direct. Alege\u0163i c\xE2te s\u0103pt\u0103m\xE2ni dori\u0163i s\u0103 eviden\u0163ia\u0163i anun\u0163ul dvs. Sunte\u0163i apoi direc\u0163ionat la pagina de plat\u0103, unde sunt disponibile mai multe op\u0163iuni de plat\u0103. Dup\u0103 achitare, ve\u0163i primi confirmarea c\u0103 anun\u0163ul dvs. este disponibil pentru intervalul de timp ales. Dac\u0103 anun\u0163ul dvs. este \xEEn conformitate cu termenii de utilizare OLX, ve\u0163i primi o confirmare prin e-mail. V\u0103 rug\u0103m s\u0103 re\u0163ine\u0163i c\u0103 nu se fac ramburs\u0103ri odat\u0103 ce a\u0163i achizi\u0163ionat un anun\u0163 eviden\u0163iat. Toate v\xE2nz\u0103rile de anun\u0163uri eviden\u0163iate sunt definitive.',
    'featured_listings.HowDoIFeatureMyAd': 'Cum \xEEmi pot eviden\u0163ia anun\u0163ul?',
    'featured_listings.HowLongWillMyListingAppearInFeaturedListings': 'C\xE2t timp va ap\u0103rea anun\u0163ul meu \xEEn sec\u0163iunea de Anun\u0163uri eviden\u0163iate?',
    'featured_listings.HowLongWillMyListingAppearInFeaturedListings_content': 'Anun\u0163urile eviden\u0163iate sunt v\xE2ndute pe s\u0103pt\u0103m\xE2n\u0103 (7 zile). V\u0103 pute\u0163i eviden\u0163ia anun\u0163ul pe o perioad\u0103 de p\xE2n\u0103 la 4 s\u0103pt\u0103m\xE2ni.',
    'featured_listings.HowMuchDoesItCost': 'C\xE2t cost\u0103?',
    'featured_listings.HowMuchDoesItCost_New': 'Anun\u0163urile eviden\u0163iate \xEEn Topul Listelor \u015Fi \xEEn Rezultatelor C\u0103ut\u0103rii cost\u0103 <<LISTING_OTHER_CATS_FEATURED_PRICE>> pe s\u0103pt\u0103m\xE2n\u0103Pute\u0163i alege c\xE2t timp dori\u0163i ca anun\u0163ul dvs. s\u0103 fie eviden\u0163iat \xEEn topul Listelor \u015Fi rezultatelor c\u0103ut\u0103rii, p\xE2n\u0103 la un maxim de 4 s\u0103pt\u0103m\xE2ni.',
    'featured_listings.HowMuchVisitsWillIncrease': 'Cu c\xE2t vor spori vizitele anun\u0163urilor mele?',
    'featured_listings.HowMuchVisitsWillIncrease_content': 'Scopul Anun\u0163urilor Eviden\u0163iate este de a m\u0103ri vizibilitatea anun\u0163ului dvs. \xCEn medie, de 8 ori mai multe persoane pot vedea anun\u0163ul dvs. \xEEn compara\u0163ie cu anun\u0163urile normale.* \xCEn categoriile cu cele mai multe anun\u0163uri, pute\u0163i avea o vizibilitate de 20 de ori mai mare.*',
    'featured_listings.IDontSeeMyListingInFeaturedListings': 'Nu v\u0103d anun\u0163ul meu \xEEn spa\u0163iul Anun\u0163urilor eviden\u0163iate.',
    'featured_listings.IDontSeeMyListingInFeaturedListings_content': 'Dac\u0103 a\u0163i cump\u0103rat un Anun\u0163 eviden\u0163iat \u015Fi nu \xEEl vede\u0163i \xEEn spa\u0163iul indicat, v\u0103 rug\u0103m s\u0103:<br /><ul><li>Verifica\u0163i dac\u0103 a\u0163i primit un email de confirmare care atest\u0103 c\u0103 anun\u0163ul dvs. eviden\u0163iat este online. Poate dura p\xE2n\u0103 la 24 de ore p\xE2n\u0103 c\xE2nd Anun\u0163ul dvs. eviden\u0163iat este evaluat.</li><li>Verifica\u0163i \xEEn email-ul de confirmare data de \xEEncepere \u015Fi de expirare a Anun\u0163ului dvs. eviden\u0163iat.</li><li>\u0162ine\u0163i cont c\u0103 anun\u0163ul dvs. este in "rota\u0163ie" cu altele din aceea\u015Fi categorie \u015Fi pozi\u0163ie, deci nu este afi\u015Fat permanent. \xCEn principiu, \xEEntr-o zi nu sunt mai mult de 18 anun\u0163uri \xEEn "rota\u0163ie" \xEEn aceea\u015Fi categorie \xEEntr-un anumit ora\u015F, prin urmare anun\u0163ul dvs. va fi afi\u015Fat aproximativ odat\u0103 la 3 \xEEnc\u0103rcari ale paginii pentru Anun\u0163urile eviden\u0163iate la \xEEnceputul list\u0103rilor \u015Fi rezultatelor c\u0103ut\u0103rii.*</li><li>\xCEn cazul \xEEn care eroarea persist\u0103, <<CONTACTLINK>>contacta\u0163i echipa noastr\u0103 de Serviciu Clien\u0163i<</CONTACTLINK>>.</li></ul>',
