    'featured_listings.UnableToFeature_NoImages': 'Noi v\u0103 putem promova anun\u0163ul numai dac\u0103 ve\u0163i include o fotografie. V\u0103 rug\u0103m actualiza\u0163i-v\u0103 Anun\u0163ul. Va dura doar un minut.',
    'featured_listings.UnableToFeature_NoImages_NoPrice': '\xCE\u0163i po\u0163i promova anun\u0163ul doar dac\u0103 specifici un pre\u0163 \u015Fi incluzi cel pu\u0163in o fotografie. Te rug\u0103m s\u0103 \xEE\u0163i actualizezi anun\u0163ul. Nu dureaz\u0103 mai mult de un minut.',
