    'featured_listings.WhyCantIModifyMyListing_content': 'Pentru a asigura o mai bun\u0103 experien\u0163\u0103 vizitatorilor (\xEEn eventualitatea c\u0103 au salvat anun\u0163ul dvs.), nu permitem modificarea Anun\u0163urilor Eviden\u0163iate p\xE2n\u0103 la expirarea op\u0163iunii Anun\u0163 Eviden\u0163iat.<br /><br />Dac\u0103 dori\u0163i s\u0103 modifica\u0163i Anun\u0163urile dvs. Eviden\u0163iate, ave\u0163i dou\u0103 op\u0163iuni:<br /><ul><li>A\u015Ftepta\u0163i p\xE2n\u0103 c\xE2nd expir\u0103 op\u0163iunea Anun\u0163 Eviden\u0163iat, modifica\u0163i anun\u0163ul \u015Fi cump\u0103ra\u0163i din nou op\u0163iunea Anun\u0163 Eviden\u0163iat, sau</li><li>Pentru modific\u0103ri extrem de importante <<CONTACTLINK>>contacta\u0163i echipa noastr\u0103 de Serviciu Clien\u0163i<</CONTACTLINK>>.</li></ul>',
